function App() {
  const status = [
    {
      title: "Status 1",
    },
    {
      title: "New",
    },
    {
      title: "Working",
    },
    {
      title: "Status 1",
    },
  ];

  return (
    <div className="bg-gray-200 h-full py-16">
      <div className="bg-white rounded shadow-inner grid justify-items-center h-20 w-9/12 mx-auto">
        <div className="w-full flex justify-center m-auto">
          <div className="h-10 w-40 border border-gray-500 flex justify-center items-center font-semibold">
            Status 1
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
